import { AST } from "eslint";
import React from "react";
import * as S from "./styled";
import { FiTrash } from "react-icons/fi";
import { type } from "os";

export type CardProps = {
  profile_image?: string;
  nickName: string;
  text_post: string;
};

const CardPost: React.FC<CardProps> = ({
  nickName,
  profile_image,
  text_post,
}) => {
  return (
    <S.Wrapper>
      <S.Content>
        <S.ImagePerfil>
          <img src={profile_image} alt="" />
          <span>{nickName}</span>
        </S.ImagePerfil>
        <S.TextPost>{text_post}</S.TextPost>
      </S.Content>
      <S.IconWrapper>
        <FiTrash />
      </S.IconWrapper>
    </S.Wrapper>
  );
};

export default CardPost;
